# Load data
def parse_tsv(file)
  lines = file.split("\n")
  lines.map do |line|
    line.to_s.chomp.split("\t", -1)
  end
end

def dsv_to_json(data)
  headers = data[0]
  json = {}
  (0...data.length - 1).each do |row|
    json[row] = {}
    headers.each_with_index do |header, col|
      json[row][header] = data[row + 1][col]
    end
  end
  json
end

def json_beautify(data)
  json = {}
  (0...data.length).each do |num|
    json[num] = data[num]
  end
  json
end

